                'description' => 'When the work required to provide a service is substantially greater than typically required, it may be identified by adding modifier -22 to the usual procedure code. Documentation must support the substantial additional work and the reason for the additional work (ie, increased intensity, time, technical difficulty of procedure, severity of patient\'s condition, physical and mental effort required). Note: This modifier should not be appended to an E/M service.',
                'name' => 'Increased procedural services',
                'anesthesia_base_unit' => NULL,
                'status' => 'Inactive',
                'created_at' => '2015-08-25 03:56:01',
                'updated_at' => '0000-00-00 00:00:00',
