                'deleted_at' => NULL,
            ),

            array(
                'id' => 3,
                'modifiers_type_id' => 1,
                'code' => 24,
                'description' => 'The physician or other qualified health care professional may need to indicate that an evaluation and management service was performed during a postoperative period for a reason(s) unrelated to the original procedure. This circumstance may be reported by adding the modifier -24 to the appropriate level of E/M service.',
                'name' => 'Unrelated E&M service by the same physician or other qualified health care professional during a postoperative period',
                'anesthesia_base_unit' => NULL,
                'status' => 'Active',
                'created_at' => '2015-08-25 03:56:01',
                'updated_at' => '0000-00-00 00:00:00',
                'created_by' => 1,
                'updated_by' => 0,
                'deleted_at' => NULL,
            ),

            array(
                'id' => 4,
                'modifiers_type_id' => 1,
                'code' => 25,
                'description' => 'It may be necessary to indicate that on the day a procedure or service identified by a CPT code was performed, the patient\'s condition required a significant, separately identified E/M service above and beyond the other service provided or beyond the usual preoperative and postoperative care associated with the procedure that was performed. A significant, separately identifiable E/M service is defined or substantiated by documentation that satisfies the relevant criteria for the respective E/M service to be reported (see Evaluation and Management Services Guidelines for instructions on determining level of E/M service). The E/M service may be prompted by the symptom or condition for which the procedure and/or service was provided. As such, different diagnoses are not required for reporting of the E/M service on the same date. This circumstance may be reported by adding modifier -25 to the approprite level of E/M service. Note: This modifier is not used to report an E/M service that resulted in a decision to perform surgery. See modifier -57. For significant, separately identifiable non-E/M services, see modifier -59.',
                'name' => 'Significant, separately identifiable E&M Service by the same physician or other qualified health care professional on the same day of the procedure or other service',
                'anesthesia_base_unit' => NULL,
                'status' => 'Active',
                'created_at' => '2015-08-25 03:56:01',
                'updated_at' => '0000-00-00 00:00:00',
                'created_by' => 1,
                'updated_by' => 0,
                'deleted_at' => NULL,
            ),

            array(
                'id' => 5,
                'modifiers_type_id' => 1,
                'code' => 26,
                'description' => 'Certain procedures are a combination of a physician or other qualified health care professional component and a technical component. When the physician or other qualified health care professional component is reported separately, the service may be identified by adding the modifier -26 to the usual procedure number.',
                'name' => 'Professional component',
                'anesthesia_base_unit' => NULL,
                'status' => 'Active',
