                'deleted_at' => NULL,
            ),

            array(
                'id' => 6,
                'modifiers_type_id' => 1,
                'code' => 27,
                'description' => 'For hospital outpatient reporting purposes, utilization of hospital resources related to separate and distinct E/M encounters performed in multiple outpatient hospital settings on the same date may be reported by adding modifier -27 to each appropriate level outpatient and/or emergency department E/M code(s). This modifier provides a means of reporting circumstances involving evaluation and management services provided by physician(s) in more than one (multiple) outpatient hospital setting(s) (eg, hospital emergency department, clinic). Note: This modifier is not to be used for physician reporting of multiple E/M services performed by the same physician on the same date. For physician reporting of all outpatient evaluation and management services provided by the same physician on the same date and performed in multiple outpatient setting(s) (eg, hospital emergency department, clinic), see Evaluation and Management, Emergency Department, or Preventive Medicine Services codes.',
                'name' => 'Multiple outpatient hospital E&M encounters on the same date',
                'anesthesia_base_unit' => NULL,
                'status' => 'Active',
                'created_at' => '2015-08-25 03:56:01',
                'updated_at' => '0000-00-00 00:00:00',
                'created_by' => 1,
                'updated_by' => 0,
                'deleted_at' => NULL,
            ),

            array(
                'id' => 7,
                'modifiers_type_id' => 1,
                'code' => 32,
                'description' => 'Services related to mandated consultation and/or related services (eg, third party payer, governmental, legislative or regulatory requirement) may be
identified by adding the modifier -32 to the basic procedure.
',
                'name' => 'Mandated services',
                'anesthesia_base_unit' => NULL,
                'status' => 'Active',
                'created_at' => '2015-08-25 03:56:01',
