            ),

            array(
                'id' => 8,
                'modifiers_type_id' => 1,
                'code' => 33,
                'description' => 'When the primary purpose of the service is the delivery of an evidence based service in accordance with a US Preventive Services Task Force A or B rating in effect and other preventive services identified in preventive services mandates (legislative or regulatory), the service may be identified by adding -33 to the procedure. For separately reported services specifically identified as preventive, the modifier should not be used.',
                'name' => 'Preventive service',
                'anesthesia_base_unit' => NULL,
                'status' => 'Active',
                'created_at' => '2015-08-25 03:56:02',
                'updated_at' => '0000-00-00 00:00:00',
