                'deleted_at' => NULL,
            ),

            array(
                'id' => 9,
                'modifiers_type_id' => 1,
                'code' => 47,
                'description' => 'Regional or general anesthesia provided by the surgeon may be reported by adding the modifier -47 to the basic service. (This does not include local anesthesia.) Note: Modifier -47 would not be used as a modifier for the Anesthesia procedures.',
                'name' => 'Anesthesia by surgeon',
                'anesthesia_base_unit' => NULL,
                'status' => 'Active',
                'created_at' => '2015-08-25 03:56:02',
                'updated_at' => '0000-00-00 00:00:00',
