            ),

            array(
                'id' => 10,
                'modifiers_type_id' => 1,
                'code' => 50,
                'description' => 'Unless otherwise identified in the listings, bilateral procedures that are performed at the same session, should be identified by adding modifier -50 to the appropriate 5 digit code. This modifier is reported when bilateral procedures requiring a separate incision are performed during the SAME operative session. Proper
reporting of this modifier on the CMS1500 health insurance claim form requires the CPT procedure code to be listed two times: first with no modifier, and the second time with modifier -50. This modifier may not be used if the definition of the basic procedure code includes the term “bilateral.”',
                'name' => 'Bilateral procedure',
                'anesthesia_base_unit' => NULL,
                'status' => 'Active',
                'created_at' => '2015-08-25 03:56:02',
                'updated_at' => '0000-00-00 00:00:00',
                'created_by' => 1,
                'updated_by' => 0,
                'deleted_at' => NULL,
            ),

            array(
                'id' => 11,
                'modifiers_type_id' => 1,
                'code' => 51,
                'description' => 'When multiple procedures, other than E/M services, Physical Medicine and Rehabilitation services, or provision of supplies (eg, vaccines), are performed at the same session by the same individual, the primary procedure or service may be reported as listed. The additional procedure(s) or service(s) may be identified by appending modifier -51 to the additional procedure or service code(s). Note: This modifier should not be appended to designated “add-on” codes.',
                'name' => 'Multiple procedures',
                'anesthesia_base_unit' => NULL,
                'status' => 'Active',
                'created_at' => '2015-08-25 03:56:02',
                'updated_at' => '0000-00-00 00:00:00',
                'created_by' => 1,
                'updated_by' => 0,
                'deleted_at' => NULL,
            ),

            array(
                'id' => 12,
                'modifiers_type_id' => 1,
                'code' => 52,
                'description' => 'Under certain circumstances a service or procedure is partially reduced or eliminated at the discretion of the physician or other qualified health care professional. Under these circumstances the service provided can be identified by its usual procedure number and the addition of the modifier -52, signifying that the service is reduced. This provides a means of reporting reduced services without disturbing the identification of the basic service. Note: For hospital outpatient reporting of a previously scheduled procedure/service that is partially reduced or cancelled as a result of extenuating circumstances or those that threaten the well-being of the patient prior to or after administration of anesthesia, see modifiers -73 and -74 (see modifiers approved for ASC hospital outpatient use) The intended use of this modifier is to report the reduction of a service without affecting provider profiles maintained by health insurance companies. Modifier -52 is another frequently misused modifier. Some medical practices mistakenly use modifier -52 to mean “reduced fee” and use it as a discounting method. Not only is this incorrect, the provider may seriously damage their provider profile with health insurance companies. The proper use for modifier -52 is to report that a service was not completed, or some part of a multiple-part service was not performed. A fee reduction may be in order as well; however that is not the primary purpose of the modifier.',
                'name' => 'Reduced services',
                'anesthesia_base_unit' => NULL,
                'status' => 'Active',
                'created_at' => '2015-08-25 03:56:02',
                'updated_at' => '0000-00-00 00:00:00',
                'created_by' => 1,
                'updated_by' => 0,
                'deleted_at' => NULL,
            ),

            array(
                'id' => 13,
                'modifiers_type_id' => 1,
                'code' => 53,
                'description' => 'Under certain circumstances, the physician or other qualified health care professional may elect to terminate a surgical or diagnostic procedure. Due to extenuating circumstances or those that threaten the well-being of the patient, it may be necessary to indicate that a surgical or diagnostic procedure was started but discontinued. This circumstance may be reported by adding modifier -53 to the code reported by the individual for the discontinued procedure. Note: This modifier is not used to report the elective cancellation of a procedure prior to the patient’s anesthesia induction and/or surgical preparation in the operating suite. For outpatient hospital/ambulatory surgery center (ASC) reporting of a previously scheduled procedure/service that is partially reduced or cancelled as a result of extenuating circumstances or those that threaten the well-being of the patient prior to or after administration of anesthesia, see modifiers -73 and -74 (see modifiers approved for ASC hospital outpatient use).',
                'name' => 'Discontinued procedure',
                'anesthesia_base_unit' => NULL,
                'status' => 'Active',
                'created_at' => '2015-08-25 03:56:02',
                'updated_at' => '0000-00-00 00:00:00',
                'created_by' => 1,
                'updated_by' => 0,
                'deleted_at' => NULL,
            ),

            array(
                'id' => 14,
                'modifiers_type_id' => 1,
                'code' => 54,
                'description' => 'When 1 physician or other qualified health care professional performs a surgical procedure and another provides preoperative and/or postoperative management, surgical services may be identified by adding modifier -54 to the usual procedure number.',
                'name' => 'Surgical care only',
                'anesthesia_base_unit' => NULL,
