            ),

            array(
                'id' => 15,
                'modifiers_type_id' => 1,
                'code' => 55,
                'description' => 'When 1 physician or other qualified health care professional performed the postoperative management and another performed the surgical procedure, the postoperative component may be identified by adding modifier -55 to the usual procedure number.',
                'name' => 'Postoperative management only',
