            array(
                'id' => 16,
                'modifiers_type_id' => 1,
                'code' => 56,
                'description' => 'When 1 physician or other qualified health care professional performed the preoperative care and evaluation and another performed the surgical procedure, the preoperative component may be identified by adding modifier -56 to the usual procedure number',
                'name' => 'Preoperative management only',
                'anesthesia_base_unit' => NULL,
                'status' => 'Active',
