            array(
                'id' => 17,
                'modifiers_type_id' => 1,
                'code' => 57,
                'description' => 'An evaluation and management service that resulted in the initial decision to perform the surgery may be identified by adding the modifier -57 to the appropriate level of E/M service. ',
                'name' => 'Decision for surgery',
                'anesthesia_base_unit' => NULL,
                'status' => 'Active',
                'created_at' => '2015-08-25 03:56:02',
