            ),

            array(
                'id' => 18,
                'modifiers_type_id' => 1,
                'code' => 58,
                'description' => 'It may be necessary to indicate that the performance of a procedure or service during the postoperative period was: (a) planned or anticipated (staged); (b) more extensive than the original procedure; or (c) for therapy following a surgical procedure. This circumstance may be reported by adding modifier -58 to the staged or related procedure. Note: For treatment of a problem that requires a return to the operating/procedure room (eg, unanticipated clinical condition), see modifier -78.',
                'name' => 'Staged or related procedure or service by the same physician or other qualified health care professional during the postoperative period',
                'anesthesia_base_unit' => NULL,
                'status' => 'Active',
                'created_at' => '2015-08-25 03:56:02',
                'updated_at' => '0000-00-00 00:00:00',
                'created_by' => 1,
                'updated_by' => 0,
                'deleted_at' => NULL,
            ),

            array(
                'id' => 19,
                'modifiers_type_id' => 1,
                'code' => 59,
                'description' => 'Under certain circumstances it may be necessary to indicate that a procedure or service was distinct or independent from other non-E/M services performed on the same day. Modifier -59 is used to identify procedures or services, other than E/M services, that are not normally reported together but are appropriate under the circumstances. Documentation must support a different session, different procedure or surgery, different site or organ system, separate incision or excision, separate lesion, or separate injury (or area of injury in extensive injuries) not ordinarily encountered or performed on the same day by the same individual. However, when another already established modifier is appropriate it should be used rather than modifier -59. Only if no more descriptive modifier is available and the use of modifier -59 bet explains the circumstances should modifier -59 be used. Note: Modifier -59 should not be appended to an E/M service. To report a separate and distinct E/M service with a non-E/M service performed on the same date, see modifier -25.',
                'name' => 'Distinct Procedural Service',
                'anesthesia_base_unit' => NULL,
                'status' => 'Active',
                'created_at' => '2015-08-25 03:56:02',
                'updated_at' => '0000-00-00 00:00:00',
                'created_by' => 1,
                'updated_by' => 0,
                'deleted_at' => NULL,
            ),

            array(
                'id' => 20,
                'modifiers_type_id' => 1,
                'code' => 62,
                'description' => 'When 2 surgeons work together as primary surgeons performing distinct part(s) of a procedure, each surgeon should report his/her distinct operative work by adding modifier -62 to the procedure code and any associated add-on code(s) for that procedure as long as both surgeons continue to work together as primary surgeons. Each surgeon should report the co-surgery once using the same procedure code. If additional procedure(s) (including add-on procedure(s) are performed during the same surgical session, separate code(s) may also be reported with modifier -62 added. Note: If a co-surgeon acts as an assistant in the performance of additional procedure(s), other than those reported with the modifier -62, during the same surgical session, those services may be reported using separate procedure code(s) with modifier -80 or modifier -82 added, as appropriate.',
                'name' => 'Two surgeons',
                'anesthesia_base_unit' => NULL,
                'status' => 'Active',
                'created_at' => '2015-08-25 03:56:02',
                'updated_at' => '0000-00-00 00:00:00',
                'created_by' => 1,
                'updated_by' => 0,
                'deleted_at' => NULL,
            ),

            array(
                'id' => 21,
                'modifiers_type_id' => 1,
                'code' => 63,
                'description' => 'Procedures performed on neonates and infants up to a present body weight of 4 kg may involve significantly increased complexity and physician or other qualified health care professional work commonly associated with these patients. This circumstance may be reported by adding modifier -63 to the procedure number. Note: Unless otherwise designated, this modifier may only be appended to procedures/services listed in the 20005-69990 code series. Modifier -63 should not be appended to any CPT codes listed in the Evaluation and Management Services, Anesthesia, Radiology, Pathology/Laboratory, or Medicine sections.',
                'name' => 'Procedure performed on infants less than 4 kg',
                'anesthesia_base_unit' => NULL,
                'status' => 'Active',
                'created_at' => '2015-08-25 03:56:02',
                'updated_at' => '0000-00-00 00:00:00',
                'created_by' => 1,
                'updated_by' => 0,
                'deleted_at' => NULL,
            ),

            array(
                'id' => 22,
                'modifiers_type_id' => 1,
                'code' => 66,
                'description' => 'Under some circumstances, highly complex procedures (requiring the concomitant services of several physicians or other qualified health care professionals, often of different specialties, plus other highly skilled specially trained personnel, various types of complex equipment) are carried out under the “surgical team” concept. Such circumstances may be identified by each participating individual with the addition of modifier -66 to the basic procedure number used for reporting services.',
                'name' => 'Surgical team',
                'anesthesia_base_unit' => NULL,
                'status' => 'Active',
                'created_at' => '2015-08-25 03:56:02',
                'updated_at' => '0000-00-00 00:00:00',
                'created_by' => 1,
                'updated_by' => 0,
                'deleted_at' => NULL,
            ),

            array(
                'id' => 23,
                'modifiers_type_id' => 1,
                'code' => 73,
                'description' => 'Due to extenuating circumstances or those that threaten the well being of the patient, the physician may cancel a surgical or diagnostic procedure subsequent to the patient’s surgical preparation (including sedation when provided, and being taken to the room where the procedure is to be performed), but prior to the administration of anesthesia (local, regional block(s) or general). Under these circumstances, the intended service that is prepared for but cancelled can be reported by its usual procedure number and the addition of the modifier -73. Note: The elective cancellation of a service prior to the administration of anesthesia and/or surgical preparation of the patient should not be reported. For physician reporting of a discontinued procedure, see modifier -53.',
                'name' => 'Discontinued out-patient hospital/ambulatory surgery center (ASC) procedure prior to the administration of anesthesia',
                'anesthesia_base_unit' => NULL,
                'status' => 'Active',
                'created_at' => '2015-08-25 03:56:02',
                'updated_at' => '0000-00-00 00:00:00',
                'created_by' => 1,
                'updated_by' => 0,
                'deleted_at' => NULL,
            ),

            array(
                'id' => 24,
                'modifiers_type_id' => 1,
                'code' => 74,
                'description' => 'Due to extenuating circumstances or those that threaten the well being of the patient, the physician may terminate a surgical or diagnostic procedure after the administration of anesthesia (local, regional block(s), general) or after the procedure was started (incision made, intubation started, scope inserted, etc.). Under these circumstances, the procedure started but terminated can be reported by its usual procedure number and the addition of the modifier -74. Note: The elective cancellation of a service prior to the administration of anesthesia and/or surgical preparation of the patient should not be reported. For physician reporting of a discontinued procedure, see modifier -53.',
                'name' => 'Discontinued out-patient hospital/ambulatory surgery center (ASC) procedure after administration of anesthesia',
                'anesthesia_base_unit' => NULL,
                'status' => 'Active',
                'created_at' => '2015-08-25 03:56:02',
                'updated_at' => '0000-00-00 00:00:00',
                'created_by' => 1,
                'updated_by' => 0,
                'deleted_at' => NULL,
            ),

            array(
                'id' => 25,
                'modifiers_type_id' => 1,
                'code' => 76,
                'description' => 'It may be necessary to indicate that a procedure or service was repeated by the same physician or other qualified health care professional subsequent to the original procedure or service. This circumstance may be reported by adding modifier -76 to the repeated procedure or service. Note: This modifier should not be appended to an E/M service.',
                'name' => 'Repeat procedure or service by same physician or other qualified health care professional',
                'anesthesia_base_unit' => NULL,
                'status' => 'Active',
