            ),

            array(
                'id' => 26,
                'modifiers_type_id' => 1,
                'code' => 77,
                'description' => 'It may be necessary to indicate that a basic procedure or service was repeated by another physician or other qualified health care professional subsequent to the original procedure or service. This circumstance may be reported by adding modifier -77 to the repeated procedure or service. Note: This modifier should not be appended to an E/M service.',
                'name' => 'Repeat procedure or service by another physician or other qualified health care professional',
                'anesthesia_base_unit' => NULL,
                'status' => 'Active',
