                'deleted_at' => NULL,
            ),

            array(
                'id' => 27,
                'modifiers_type_id' => 1,
                'code' => 78,
                'description' => 'It may be necessary to indicate that another procedure was performed during the postoperative period of the initial procedure (unplanned procedure following initial procedure). When this procedure is related to the first and requires the use of an operating/procedure room, it may be reported by adding modifier -78 to the related procedure. (For repeat procedures, see modifier -76.)',
                'name' => 'Unplanned return to the operating/procedure room by the same physician or other qualified health care professional following initial procedure for a related procedure during the postoperative period',
