                'updated_by' => 0,
                'deleted_at' => NULL,
            ),

            array(
                'id' => 28,
                'modifiers_type_id' => 1,
                'code' => 79,
                'description' => 'The individual may need to indicate that the performance of a procedure or service during the postoperative period was unrelated to the original procedure. This circumstance may be reported by using modifier -79. (For repeat procedures on the same day, see ‘-76.’)',
                'name' => 'Unrelated procedure or service by the same physician or other qualified health care professional during the postoperative period',
                'anesthesia_base_unit' => NULL,
