                'modifiers_type_id' => 1,
                'code' => 82,
                'description' => 'The unavailability of a qualified resident surgeon is a prerequisite for use of modifier -82 appended to the usual procedure code number(s).',
                'name' => 'Assistant surgeon (when qualified resident surgeon not available)',
                'anesthesia_base_unit' => NULL,
