            array(
                'id' => 1,
                'type' => 'Practice',
                'title' => 'Practice help page',
                'slug' => 'practice',
                'content' => '<p><a href=\"https://www.youtube.com/watch?v=D8DjUwrp0Yo\">https://www.youtube.com/watch?v=D8DjUwrp0Yo</a></p>

<p>A general practitioner manages types of illness that present in an undifferentiated way at an early stage of development, which may require urgent intervention.<sup><a href=\"https://en.wikipedia.org/wiki/General_practitioner#cite_note-1\">[1]</a></sup>&nbsp;The&nbsp;<a href=\"https://en.wikipedia.org/wiki/Holism\" title=\"Holism\">holistic</a>&nbsp;approach of general practice aims to take into consideration the biological, psychological and social factors relevant to the care of each patient&#39;s illness. Their duties are not confined to specific organs of the body, and they have particular skills in treating people with multiple health issues. They are trained to treat patients of any age and sex to levels of complexity that vary between countries.</p>

<p>The role of a GP can vary greatly between (or even within) countries. In urban areas of developed countries their roles tend to be narrower and focused on the care of chronic health problems; the treatment of acute non-life-threatening diseases; the early detection and referral to specialized care of patients with serious diseases; and preventative care including health education and immunization. Meanwhile, in rural areas of developed countries or in developing countries a GP may be routinely involved in pre-hospital emergency care, the delivery of babies, community hospital care and performing low-complexity surgical procedures.<sup><a href=\"https://en.wikipedia.org/wiki/General_practitioner#cite_note-2\">[2]</a></sup><sup><a href=\"https://en.wikipedia.org/wiki/General_practitioner#cite_note-3\">[3]</a></sup><sup><a href=\"https://en.wikipedia.org/wiki/General_practitioner#cite_note-4\">[4]</a></sup>&nbsp;In some healthcare systems GPs work in primary care centers where they play a central role in the healthcare team, while in other models of care GPs can work as single-handed practitioners.</p>

<p>&nbsp;</p>
',
