            array(
                'id' => 2,
                'type' => 'Facility',
                'title' => 'Facility help page',
                'slug' => 'facility',
                'content' => '<h4><span style=\"font-size:14px\"><span style=\"color:#696969\">A&nbsp;<strong>Health facility</strong>&nbsp;is, in general, any location where health care is provided. Health facilities range from small&nbsp;</span><a href=\"https://en.wikipedia.org/wiki/Clinic\" title=\"Clinic\"><span style=\"color:#696969\">clinics</span></a><span style=\"color:#696969\">&nbsp;and&nbsp;</span><a href=\"https://en.wikipedia.org/wiki/Doctor%27s_office\" title=\"Doctor\'s office\"><span style=\"color:#696969\">doctor&#39;s offices</span></a><span style=\"color:#696969\">&nbsp;to&nbsp;</span><a href=\"https://en.wikipedia.org/wiki/Urgent_care\" title=\"Urgent care\"><span style=\"color:#696969\">urgent care</span></a><span style=\"color:#696969\">&nbsp;centers and large</span><a href=\"https://en.wikipedia.org/wiki/Hospital\" title=\"Hospital\"><span style=\"color:#696969\">hospitals</span></a><span style=\"color:#696969\">&nbsp;with elaborate&nbsp;</span><a href=\"https://en.wikipedia.org/wiki/Emergency_room\" title=\"Emergency room\"><span style=\"color:#696969\">emergency rooms</span></a><span style=\"color:#696969\">&nbsp;and&nbsp;</span><a href=\"https://en.wikipedia.org/wiki/Trauma_center\" title=\"Trauma center\"><span style=\"color:#696969\">trauma centers</span></a><span style=\"color:#696969\">. The number and quality of health facilities in a&nbsp;</span><a href=\"https://en.wikipedia.org/wiki/Country\" title=\"Country\"><span style=\"color:#696969\">country</span></a><span style=\"color:#696969\">&nbsp;or region is one common measure of that area&#39;s</span><a href=\"https://en.wikipedia.org/wiki/Prosperity\" title=\"Prosperity\"><span style=\"color:#696969\">prosperity</span></a><span style=\"color:#696969\">&nbsp;and&nbsp;</span><a href=\"https://en.wikipedia.org/wiki/Quality_of_life\" title=\"Quality of life\"><span style=\"color:#696969\">quality of life</span></a><span style=\"color:#696969\">. In many countries, health facilities are&nbsp;</span><a href=\"https://en.wikipedia.org/wiki/Regulation\" title=\"Regulation\"><span style=\"color:#696969\">regulated</span></a><span style=\"color:#696969\">&nbsp;to some extent by&nbsp;</span><a href=\"https://en.wikipedia.org/wiki/Health_law\" title=\"Health law\"><span style=\"color:#696969\">law</span></a><span style=\"color:#696969\">;&nbsp;</span><a href=\"https://en.wikipedia.org/wiki/Licensing\" title=\"Licensing\"><span style=\"color:#696969\">licensing</span></a><span style=\"color:#696969\">&nbsp;by a regulatory agency is often required before a facility may open for business. Health facilities may be owned and operated by&nbsp;</span><a href=\"https://en.wikipedia.org/wiki/Business\" title=\"Business\"><span style=\"color:#696969\">for-profit businesses</span></a><span style=\"color:#696969\">,&nbsp;</span><a href=\"https://en.wikipedia.org/wiki/Non-profit_organization\" title=\"Non-profit organization\"><span style=\"color:#696969\">non-profit organizations</span></a><span style=\"color:#696969\">,&nbsp;</span><a href=\"https://en.wikipedia.org/wiki/Government\" title=\"Government\"><span style=\"color:#696969\">governments</span></a><span style=\"color:#696969\">, and in some cases by&nbsp;</span><a href=\"https://en.wikipedia.org/wiki/Individual\" title=\"Individual\"><span style=\"color:#696969\">individuals</span></a><span style=\"color:#696969\">, with proportions varying by country.</span></span></h4>
',
