            array(
                'id' => 4,
                'type' => 'Insurance',
                'title' => 'Insurance help page',
                'slug' => 'insurance',
                'content' => '<p>A&nbsp;<a href=\"https://en.wikipedia.org/wiki/Health\" title=\"Health\">health</a>&nbsp;<a href=\"https://en.wikipedia.org/wiki/Insurance\" title=\"Insurance\">insurance</a>&nbsp;policy is:</p>

<ol>
	<li>A&nbsp;<a href=\"https://en.wikipedia.org/wiki/Insurance_contract\" title=\"Insurance contract\">contract</a>&nbsp;between an insurance provider (e.g. an insurance company or a government) and an individual or his/her sponsor (e.g. an employer or a community organization). The contract can be renewable (e.g. annually, monthly) or lifelong in the case of private insurance, or be mandatory for all citizens in the case of national plans. The type and amount of health care costs that will be covered by the health insurance provider are specified in writing, in a member contract or &quot;Evidence of Coverage&quot; booklet for private insurance, or in a national&nbsp;<a href=\"https://en.wikipedia.org/wiki/Health_policy\" title=\"Health policy\">health policy</a>&nbsp;for public insurance.</li>
	<li>Provided by an employer-sponsored self-funded&nbsp;<a href=\"https://en.wikipedia.org/wiki/Employee_Retirement_Income_Security_Act\" title=\"Employee Retirement Income Security Act\">ERISA</a>&nbsp;plan. The company generally advertises that they have one of the big insurance companies. However, in an ERISA case, that insurance company &quot;doesn&#39;t engage in the act of insurance&quot;, they just administer it. Therefore, ERISA plans are not subject to state laws. ERISA plans are governed by federal law under the jurisdiction of the US Department of Labor (USDOL). The specific benefits or coverage details are found in the Summary Plan Description (SPD). An appeal must go through the insurance company, then to the Employer&#39;s Plan Fiduciary. If still required, the Fiduciary&#39;s decision can be brought to the USDOL to review for ERISA compliance, and then file a lawsuit in federal court.</li>
</ol>
',
