            array(
                'id' => 5,
                'type' => 'CPT',
                'title' => 'CPT help page',
                'slug' => 'cpt',
                'content' => '<h3><strong>What is a CPT code?</strong></h3>

<p>CPT is an acronym for Current Procedural Terminology.&nbsp;&nbsp; CPT codes are published by the American Medical Association,&nbsp; and the fourth edition&nbsp; is the most current.&nbsp;&nbsp; The purpose of the coding system is to provide uniform language that accurately describes medical, surgical, and diagnostic services.</p>

<p>A CPT code is a five digit numeric code that is&nbsp; used to describe medical, surgical, radiology, laboratory, anesthesiology, and evaluation/management services of physicians, hospitals, and other health care providers.&nbsp; There are approximately 7,800 CPT codes ranging from 00100 through 99499.&nbsp; Two digit modifiers may be appended when appropriate to clarify or modify the description of the procedure.</p>

<p>It is published in two versions &ndash; the first is the most common, CPT Physician&rsquo;s Current Procedural Terminology. A second publication is also available &ndash; the CPT Physician&rsquo;s Current Procedural Terminology Specially Annotated for Hospitals. The Hospital version contains all the information in the original version with the addition of special Medicare guidelines and notations for identifying criteria applicable to outpatient hospital billing.</p>

<p>The rules for assigning the appropriate code are complex, and so we advise individuals who are determining the appropriate codes receive the proper training and credentials.&nbsp; This would include any office or clinic personnel who play a significant role in coding.</p>
',
