            array(
                'id' => 6,
                'type' => 'ICD',
                'title' => 'ICD help page',
                'slug' => 'icd',
                'content' => '<p>The&nbsp;<strong>International Statistical Classification of Diseases and Related Health Problems</strong>, usually called by the short-form name&nbsp;<strong>International Classification of Diseases</strong>&nbsp;(<strong>ICD</strong>), is the international &quot;standard diagnostic tool for epidemiology, health management and clinical purposes&quot;.<sup><a href=\"https://en.wikipedia.org/wiki/International_Statistical_Classification_of_Diseases_and_Related_Health_Problems#cite_note-1\">[1]</a></sup>&nbsp;The ICD is maintained by the&nbsp;<a href=\"https://en.wikipedia.org/wiki/World_Health_Organization\" title=\"World Health Organization\">World Health Organization</a>, the directing and coordinating authority for health within the&nbsp;<a href=\"https://en.wikipedia.org/wiki/United_Nations\" title=\"United Nations\">United Nations</a>System.<sup><a href=\"https://en.wikipedia.org/wiki/International_Statistical_Classification_of_Diseases_and_Related_Health_Problems#cite_note-2\">[2]</a></sup>&nbsp;The ICD is designed as a health care classification system, providing a system of diagnostic codes for classifying&nbsp;<a href=\"https://en.wikipedia.org/wiki/Disease\" title=\"Disease\">diseases</a>, including nuanced classifications of a wide variety of signs, symptoms, abnormal findings, complaints, social circumstances, and external causes of injury or disease. This system is designed to map health conditions to corresponding generic categories together with specific variations, assigning for these a designated code, up to six characters long. Thus, major categories are designed to include a set of similar diseases.</p>

<p>The International Classification of Diseases is published by the World Health Organization (WHO) and used worldwide for morbidity and mortality statistics,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Reimbursement\" title=\"Reimbursement\">reimbursement</a>&nbsp;systems, and automated decision support in<a href=\"https://en.wikipedia.org/wiki/Health_care\" title=\"Health care\">health care</a>. This system is designed to promote international comparability in the collection, processing, classification, and presentation of these statistics. As in the case of the analogous (but limited to mental and behavioral disorders)&nbsp;<a href=\"https://en.wikipedia.org/wiki/Diagnostic_and_Statistical_Manual_of_Mental_Disorders\" title=\"Diagnostic and Statistical Manual of Mental Disorders\">Diagnostic and Statistical Manual of Mental Disorders</a>&nbsp;(DSM, currently in version 5), the ICD is a major project to statistically classify health disorders, and provide diagnostic assistance. The ICD is a core statistically-based classificatory diagnostic system for health care related issues of the&nbsp;<a href=\"https://en.wikipedia.org/wiki/WHO_Family_of_International_Classifications\" title=\"WHO Family of International Classifications\">WHO Family of International Classifications</a>&nbsp;(WHO-FIC).<sup><a href=\"https://en.wikipedia.org/wiki/International_Statistical_Classification_of_Diseases_and_Related_Health_Problems#cite_note-WHO-FIC-3\">[3]</a></sup></p>

<p>The ICD is revised periodically and is currently in its tenth revision. The&nbsp;<a href=\"https://en.wikipedia.org/wiki/ICD-10\" title=\"ICD-10\">ICD-10</a>, as it is therefore known, was developed in 1992 to track health statistics. ICD-11 is planned for 2017.<sup><a href=\"https://en.wikipedia.org/wiki/International_Statistical_Classification_of_Diseases_and_Related_Health_Problems#cite_note-4\">[4]</a></sup><sup><a href=\"https://en.wikipedia.org/wiki/International_Statistical_Classification_of_Diseases_and_Related_Health_Problems#cite_note-WHO_ICD-11_Revision_information-5\">[5]</a></sup>&nbsp;As of 2007, development plans included using&nbsp;<a href=\"https://en.wikipedia.org/wiki/Web_2.0\" title=\"Web 2.0\">Web 2.0</a>&nbsp;principles to support detailed revision.<sup><a href=\"https://en.wikipedia.org/wiki/International_Statistical_Classification_of_Diseases_and_Related_Health_Problems#cite_note-Wikipedia-6\">[6]</a></sup>&nbsp;Annual minor updates and&nbsp;<a href=\"https://en.wikipedia.org/wiki/Triennial\" title=\"Triennial\">triennial</a>&nbsp;major updates are published by the WHO.<sup><a href=\"https://en.wikipedia.org/wiki/International_Statistical_Classification_of_Diseases_and_Related_Health_Problems#cite_note-7\">[7]</a></sup>&nbsp;The ICD is part of a &quot;family&quot; of guides that can be used to complement each other, including also the&nbsp;<a href=\"https://en.wikipedia.org/wiki/International_Classification_of_Functioning,_Disability_and_Health\" title=\"International Classification of Functioning, Disability and Health\">International Classification of Functioning, Disability and Health</a>&nbsp;which focuses on the domains of functioning (disability) associated with health conditions, from both medical and social perspectives.</p>
',
