            ),

            array(
                'id' => 8,
                'type' => 'Modifiers',
                'title' => 'Modifier help page',
                'slug' => 'modifiers',
                'content' => '<h4><span style=\"font-size:12px\"><span style=\"color:#0000FF\"><em>Modifiers</em></span></span></h4>

<h4><br />
<span style=\"font-size:12px\"><span style=\"color:#0000FF\">What happens if your procedure doesn&rsquo;t fit a specific code? What if it takes more time than usual or your doctor has to run two lab tests instead of one? For those situations, providers add on a two-digit &ldquo;modifier&rdquo; to the CPT or HCPCS code. This modifier gives your plan those additional details. Then, your plan may use this information to adjust their payment. Modifiers might also be used for some diagnostic tests, like X-rays, CT scans, or lab services that have two pieces: the service that your doctor provides, and the technical equipment and staff that they use. The modifier &ldquo;26&rdquo; is used to describe the professional service. The modifier &ldquo;TC&rdquo; is used to describe the technical equipment. - See more at: http://fairhealthconsumer.org/reimbursementseries.php?id=34#sthash.l8SVGXnV.dpuf</span></span></h4>

<h4>&nbsp;</h4>

<h4><span style=\"font-size:12px\"><span style=\"color:#0000FF\"><strong>What Are Some Common Modifiers?</strong><br />
<br />
These are some common modifiers you may see on your provider&rsquo;s claim form:</span></span></h4>

<ul>
	<li>
	<h4><span style=\"font-size:12px\"><span style=\"color:#0000FF\">22: The procedure was unusually complicated and took more time than the general CPT code allows.</span></span></h4>
	</li>
	<li>
	<h4><span style=\"font-size:12px\"><span style=\"color:#0000FF\">51: Your surgeon performed more than one surgical procedure during the same operation.</span></span></h4>
	</li>
	<li>
	<h4><span style=\"font-size:12px\"><span style=\"color:#0000FF\">76: Your doctor performed the same procedure more than once during your visit. For example, you may have had multiple X-rays on the same day.</span></span></h4>
	</li>
	<li>
	<h4><span style=\"font-size:12px\"><span style=\"color:#0000FF\">91: Your doctor repeated the same diagnostic test, usually on the same day. This might happen if, for example, your first test result is abnormal. Then your doctor might want to re-run the test later in the day.</span></span></h4>
	</li>
</ul>

<h4><span style=\"font-size:12px\"><span style=\"color:#0000FF\">- See more at: http://fairhealthconsumer.org/reimbursementseries.php?id=34#sthash.l8SVGXnV.dpuf</span></span></h4>
',
                'status' => 'Active',
