            array(
                'id' => 10,
                'type' => 'Codes',
                'title' => 'Codes help page',
                'slug' => 'code',
                'content' => '<h1>Introduction to Billing Code Systems</h1>

<p><strong>Accurate coding is essential for claims submitted to third party payers.&nbsp; The codes identify:</strong></p>

<ul>
	<li>procedures performed</li>
	<li>diagnosis or diagnoses</li>
	<li>certain devices, supplies and equipment acquired for the client</li>
</ul>

<p>The&nbsp;&nbsp;<a href=\"http://www.asha.org/uploadedFiles/HealthCareCodingSystems(1).pdf\" title=\"HealthCareCodingSystems\">health care services coding system</a>&nbsp;[PDF]&nbsp;is regulated by the Centers of Medicare and Medicaid Services (CMS).&nbsp;CMS established recognized code sets under the Health Insurance Portability and Accountability Act (HIPAA):</p>

<p><strong>CPT (Current Procedural Terminology)</strong><br />
The CPT coding system describes how to report procedures or services.&nbsp;The CPT system is maintained and copyrighted by the&nbsp;&nbsp;<a href=\"http://www.ama-assn.org/ama/pub/category/3113.html\">American Medical Association</a>.&nbsp;Each CPT code has five digits.&nbsp;The AMA CPT Editorial Panel reviews and responds to requests for additions to or revisions of the CPT.</p>

<p><strong>HCPCS (Healthcare Common Procedures Coding System)</strong>&nbsp;<br />
HCPCS codes are used to report supplies, equipment, and devices provided to patients.&nbsp;A limited number of procedures not otherwise contained in the CPT system are also found here.&nbsp;HCPCS is alphanumeric and is administered by the&nbsp;&nbsp;<a href=\"http://www.cms.hhs.gov/MedHCPCSGenInfo/\">Centers for Medicare and Medicaid Services</a>&nbsp;(CMS) in cooperation with other third party payers.</p>

<p>CMS includes two levels in its Healthcare Common Procedures Coding System:&nbsp;<br />
HCPCS Level I is the CPT coding system; HCPCS Level II is usually referred to as HCPCS codes, described above.</p>

<p><strong>ICD-9-CM (International Classification of Diseases, 9th revision,&nbsp;Clinical Modification)</strong>&nbsp;<br />
Healthcare professionals use these codes (which have 3 numeric digits followed by decimal point) to report diagnoses and disorders.&nbsp;The ICD-9-CM is maintained by the National Center for Health Statistics of the U.S. Public Health Service.&nbsp;The&nbsp;&nbsp;<a href=\"http://www.cdc.gov/nchs/about/otheract/icd9/abticd10.htm\">ICD-10-CM</a>&nbsp;is in revised draft stage&nbsp;and is scheduled to replace&nbsp;ICD-9-CM on October 1, 2015.</p>

<p>Note that ICD-9-CM V codes are used to record a condition influencing health status or broad types of procedural, administrative or screening encounters.&nbsp;They are often not accepted for billing purposes by third party payers.</p>
',
